s($,"aBU","afj",()=>A.c([A.lG("Samhain marca o limite entre o Ano Velho e o Novo, celebrando a passagem do outono ao inverno. \xc9 o momento de honrar ancestrais, refletir sobre o que ficou para tr\xe1s e preparar-se para renascer internamente. As chamas dos fogueiras purificam e protegem, enquanto oferendas atraem b\xean\xe7\xe3os das almas que partem.\n\nNo Hemisf\xe9rio Norte, ocorre em 31 de outubro e se estende at\xe9 1\xba de novembro. No Sul, espelha-se em 1\xba de maio, invertendo as esta\xe7\xf5es, mas mantendo o mesmo esp\xedrito de introspec\xe7\xe3o e renova\xe7\xe3o interna. Cada lado do globo ajusta rituais para o clima local, mas o elo com os mortos permanece inalterado.\n\nNesta celebra\xe7\xe3o, a Deusa aparece como Anci\xe3, a Guardi\xe3 da Sabedoria Oculta. Ela carrega um cajado entalhado em sombras e estrelas, incentivando a busca por respostas no limiar entre vida e morte. Sua persona lembra que o conhecimento ancestral guia decis\xf5es futuras.\n\nUma lenda c\xe9ltica conta sobre o \u201cC\xe3odormo Eterno\u201d, guardi\xe3o espectral que protege aldeias na noite de Samhain. Dizem que, se algu\xe9m acender um espantalho com runas de salva\xe7\xe3o, o C\xe3odormo conduz as almas ben\xe9volas para reencontros com os vivos, restabelecendo la\xe7os esquecidos.","assets/images/samhain.jpg","Marca o limite entre o Ano Velho e o Ano Novo.","Samhain"),A.lG("Yule celebra o solst\xedcio de inverno, quando o dia atinge seu ponto mais curto e come\xe7a a se expandir. Esse retorno gradual da luz simboliza a vit\xf3ria da esperan\xe7a sobre as sombras. Troncos de carvalho enfeitados com visco, azevinho e velas vermelham a noite, aquecendo o lar e o cora\xe7\xe3o.\n\nNo Hemisf\xe9rio Norte, manifesta-se entre 20 e 23 de dezembro. J\xe1 no Sul, ocorre de 20 a 23 de junho, acompanhando o auge do ver\xe3o. Apesar da invers\xe3o solar, o tema central permanece: acolher o renascimento do Sol e agradecer sua for\xe7a restauradora.\n\nA Deusa resplandece como M\xe3e-Sol, trazendo calor e nutri\xe7\xe3o. Seu manto branco bordado de bagas vermelhas reflete a dualidade luz-sombra. Ela enfatiza a fertilidade latente sob o solo frio, lembrando que toda semente aguarda o momento certo para florescer.\n\nEntre as hist\xf3rias, destaca-se a lenda do \u201cVeado de Chifres de Luz\u201d. Conta-se que ele percorre bosques nevados, espalhando fagulhas que se transformam em estrelas no c\xe9u. Aqueles que seguirem seu rastro encontram inspira\xe7\xe3o interior para atravessar qualquer escurid\xe3o.","assets/images/yule.jpg","Yule celebra o solst\xedcio de inverno.","Evento 2"),A.lG("Imbolc anuncia o despertar da terra que ainda dorme. Realizado em 1\xba de fevereiro no Norte e em 1\xba de agosto no Sul, \xe9 o momento de limpar, purificar e acender a primeira fa\xedsca de esperan\xe7a no ano. Fontes de \xe1gua corrente e l\xe2mpadas de \xf3leo representam o fluir da renova\xe7\xe3o.\n\nA Deusa surge como Donzela-Renascentista, gr\xe1vida de luz. Seu v\xe9u cor de leite simboliza a promessa de novas vidas, enquanto tochas brancas lembram o calor que se aproxima. Ela inspira rituais de limpeza espiritual e consagra\xe7\xe3o de espa\xe7os sagrados.\n\nNa tradi\xe7\xe3o irlandesa, celebra-se Brigid de Kildare, padroeira do fogo sagrado e das fontes. A lenda diz que Brigid aben\xe7oou um caldeir\xe3o de leite fervido, transformando-o em po\xe7\xe3o de cura que se derramou nas terras ao redor, dando in\xedcio a campos f\xe9rteis e gado saud\xe1vel.\n\nEmbora as esta\xe7\xf5es invertem-se no hemisf\xe9rio Sul, a ess\xeancia permanece: acender a chama interior que guia a transforma\xe7\xe3o. No Norte, vig\xedlias noturnas observam o nascer do sol; no Sul, as primeiras luas de inverno aparecem sobre campos silentes, mas cheios de vida em potencial.","assets/images/imbolc.jpg","Imbolc anuncia o despertar da terra que ainda dorme.","Imbolc"),A.lG("Ostara celebra o equin\xf3cio de primavera, quando dia e noite se equilibram. \xc9 o renascimento florescente, marcado por cores pastel e cantos de aves que retornam. Ovos pintados, coelhos simb\xf3licos e dan\xe7as circulares ao redor de mastros floridos evocam fertilidade em cada sopro de vento.\n\nNo Hemisf\xe9rio Norte, acontece em 20 ou 21 de mar\xe7o. No Sul, desloca-se para 22 ou 23 de setembro, anunciando o outono, mas preservando o tema de equil\xedbrio e gratid\xe3o pela colheita futura ou passada. Em ambos os polos, celebra-se a harmonia entre luz e sombra.\n\nA Deusa aparece como Jovem Donzela, envolta em vestido de p\xe9talas. Ela representa inoc\xeancia e potencial ilimitado. Seu disco solar nas m\xe3os desperta sementes adormecidas, incentivando rituais de plantio simb\xf3lico e reflex\xe3o sobre novos come\xe7os.\n\nUma antiga lenda germ\xe2nica fala de Eostre, deusa da aurora, que encontrou um p\xe1ssaro colorido ferido pelo inverno. Ao toc\xe1-lo, ela o transformou em lebre, mas manteve sua habilidade de p\xf4r ovos pintados, presenteando o mundo com celebra\xe7\xf5es de beleza e renova\xe7\xe3o.","assets/images/ostara.jpg","Ostara celebra o equin\xf3cio de primavera, quando dia e noite se equilibram.","Ostara"),A.lG("Beltane celebra o \xe1pice da primavera, entre 30 de abril e 1\xba de maio no Norte, e entre 31 de outubro e 1\xba de novembro no Sul. Fogueiras g\xeameas s\xe3o acesas para purificar e proteger, enquanto coroa de flores e dan\xe7as rituais evocam a uni\xe3o sagrada entre o masculino e o feminino.\n\nA Deusa manifesta-se como a Amante Primaveril, vibrante em chita colorida e coroa de rosas silvestres. Ela personifica a paix\xe3o criativa e o florescer da vida amorosa. Seus c\xe1lices de hidromel flutuam em brindes, refor\xe7ando la\xe7os afetivos e abund\xe2ncia emocional.\n\nNa mitologia irlandesa, celebra-se a dupla Deusa Cailleach e Beira, que revesam as esta\xe7\xf5es. Beltane marca a coroa\xe7\xe3o de Beira, a Rainha das Flores. Uma lenda narra que ela dan\xe7ou sobre a comunidade, fazendo brotar margaridas e rosas no rastro de seus p\xe9s.\n\nApesar do invertido calend\xe1rio nos hemisf\xe9rios, Beltane continua a exaltar fertilidade. No Norte, festeja-se ao redor de fogueiras; no Sul, equivalentes de Samhain \u2013 mas com enfoque na celebra\xe7\xe3o do amor e na promessa de novas cria\xe7\xf5es.","assets/images/beltane.jpg","Beltane celebra o \xe1pice da primavera.","Beltane"),A.lG("Litha, o solst\xedcio de ver\xe3o, ocorre em 20\u201323 de junho no Hemisf\xe9rio Norte e em 20\u201323 de dezembro no Sul. \xc9 o \xe1pice da luz, quando o Sol alcan\xe7a seu z\xeanite. Festivais ao ar livre exaltam a for\xe7a solar, a matura\xe7\xe3o de plantas e a generosidade da terra.\n\nA Deusa irradia como M\xe3e-Sol, sua coroa de girass\xf3is representa o \xe1pice do poder vital. Ela exibe um escudo espelhado, refletindo luz intensa em todos os cantos. Este \xe9 o momento de agradecer pela safra que vir\xe1 e de fortalecer projetos pessoais com energia solar.\n\nNa tradi\xe7\xe3o n\xf3rdica, invoca-se a deusa S\xf3l, que conduz a carruagem solar pelos c\xe9us. Uma lenda conta que Loki tentou ofuscar seu brilho com uma nuvem eterna, mas S\xf3l o dissipou com um sorriso de fogo, restaurando dias intermin\xe1veis de claridade e calor.\n\nAo invertido solst\xedcio no Sul, as \xeanfases mudam: celebra\xe7\xf5es noturnas e fogueiras de dia lembram o ciclo reverso. Ainda assim, o convite permanece: absorver toda a luz dispon\xedvel e distribu\xed-la em a\xe7\xf5es criativas e celebra\xe7\xf5es comunit\xe1rias.","assets/images/litha.jpg","Litha, o solst\xedcio de ver\xe3o.","Litha"),A.lG("Lammas, ou Lughnasadh, celebrado em 1\xba de agosto no Norte e 1\xba de fevereiro no Sul, inaugura a colheita dos gr\xe3os. \xc9 hora de agradecer ao cereal e aos trabalhadores rurais. P\xe3es r\xfasticos, bolos de aveia e oferendas simb\xf3licas \xe0 Terra garantem prosperidade at\xe9 o pr\xf3ximo ano.\n\nA Deusa surge como M\xe3e da Colheita, vestida de manto terroso cravejado de espigas douradas. Ela aben\xe7oa cada gr\xe3o colhido e inspira rituais de partilha comunit\xe1ria. Suas m\xe3os carregam foices de bronze, incentivando a gratid\xe3o e o cuidado m\xfatuo.\n\nNa mitologia celta, realiza-se o festival de Lugh, o \u201cluminoso\u201d, que instituiu os jogos de colheita em homenagem \xe0 m\xe3e Tailtiu. Uma lenda diz que Tailtiu desafiou-se a limpar florestas em chamas para cultivar a primeira cevada, e seu sacrif\xedcio deu origem ao festival em sua mem\xf3ria.\n\nEmbora as datas invertam-se no Sul, Lammas preserva seu car\xe1ter de celebra\xe7\xe3o agr\xedcola. O foco \xe9 sempre a oferta coletiva: no Norte, em pomares ensolarados; no Sul, em p\xe2ntanos \xfamidos, mas com a mesma devo\xe7\xe3o \xe0 abund\xe2ncia e ao ciclo vital.","assets/images/lammas.jpg","Lammas inaugura a colheita dos gr\xe3os.","Lammas"),A.lG("Mabon celebra o equin\xf3cio de outono, entre 21 e 24 de setembro no Norte e 20 e 23 de mar\xe7o no Sul. Este \xe9 o momento de equil\xedbrio entre luz e sombra e de agradecer pela colheita que se encerra. Mesas comunit\xe1rias com frutas, nozes e vinho simbolizam a gratid\xe3o pelos frutos do esfor\xe7o.\n\nA Deusa aparece como a Anci\xe3 Grata, em manto de veludo bordado com sementes e folhas ca\xeddas. Suas m\xe3os oferecem uma cornuc\xf3pia transbordante. Ela ensina o valor da partilha e lembra que, ao equilibrar dar e receber, mantemos a harmonia com a Terra.\n\nNa mitologia galesa, Mabon ap Modron \xe9 filho da Deusa da Terra. A lenda narra seu sequestro aos tr\xeas dias de nascido, causando desordem no mundo at\xe9 ser resgatado por her\xf3is. Seu retorno restabeleceu a ordem e inspirou o festival de agradecimento.\n\nMesmo no Hemisf\xe9rio Sul, onde Mabon coincide com o equin\xf3cio de outono, o esp\xedrito de gratid\xe3o e equil\xedbrio permanece intacto. Comunidades adoram de m\xe3os dadas com a natureza, celebrando a maturidade do ano e preparando-se para o per\xedodo introspectivo que se avizinha.","assets/images/mabon.jpg","Mabon \xe9 o equilibrio entre a luz e a sombra.","Mabon")],A.ak("y<CN>")))
